DESCRIPTION:
Noriu iškelti klausimą dėl tvarkos ties Žalgirio g. 108 vartais. Į šią teritoriją darbo dienomis atvyksta didelių gabaritų sunkiasvoris transportui, tad yra kelio ženklas, draudžiantis sustoti ir stovėti 10m nuo stulpo iki įsukimo. Neilgam buvo atsiradusi papildoma informacinė kilnojama lentelė su užrašu NEUŽSTATYTI. Tačiau kadangi ji kelia nugriuvimo pavojų, ar erdvės trūkumą prasilenkiant, ji buvo staiga nuimta (dingo). Draudžiantis kelio ženklas yra tik iš vienos pusės, t.y. tik atvažiuojant nuo Žalgirio gatvės, taigi atvažiuojantys nuo Laumėnų g. pusės, ženklo nepastebi. Dabar tapo madinga statyti automobilius ant to kalniuko tarp vartų ir šaligatvio. Palikus mašiną ant jo, vilkikai taip pat negali išsukti. Ar būtų galima padaryti 1 iš šių sprendimų:
1. Nubraižyti geltoną korį tiek palei šaligatvį nuo stulpo, tiek ant posūkio šalia to &#34;kalniuko&#34;
2. Pakabinti draudžiantį ženklą ir iš kitos stulpo pusės, nes pastato savininkas delsia tai atlikti, nors ne kartą apie tai jam siūlyta.

